import {Link, Outlet } from "react-router-dom"

function Layout() {
    return (
        <>
            <nav className="header">
                <Link to="/main">Main</Link>
                <br />
                <Link to="/profile">Profile</Link>
            </nav>

            <Outlet />
        </>  
    );
}

export default Layout;
